INSERT INTO `handy-ringhalter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Handy-Ringhalter/Syncwire Handy-Ringhalter.webp;', 'Syncwire Handy-Ringhalter', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo3NTE5NTU5MzY5NDYwNTQ2OjE2Njc2NDQxNTQ6c3BfYXRmOjIwMDYyNjI1NDc4NDk4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FSyncwire-Fingerhalterung-Smartphone-Handyring-fingerhalten%2Fdp%2FB07V6P9QT9%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D395AN9T1SC8BF%26keywords%3DSyncwire%2BHandy-Ringhalter%26qid%3D1667644154%26qu%3DeyJxc2MiOiIxLjAzIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3D%252Caps%252C72%26sr%3D8-2-spons%26psc%3D1', '13,99', 4.5, 10518, 1, 'Syncwire;Edelstahl;【Hochwertig und gut verarbeitet】Hergestellt aus hochwertiger Zinklegierung (Aufkleberteil) und Edelstahl (Ringgriffteil), bietet der Syncwire Telefonringhalter eine unerreichte Haltbarkeit, um auch bei Sturzunfällen intakt zu bleiben. Die Oberfläche des Ringhalters ist mit Vakuum Ionen beschichtet, um ihn vor der Oxidationswirkung zu schützen und seine glänzende Oberfläche zu erhalten. Die Kanten des Ringgriffs sind zum Schutz der Finger sorgfältig poliert.|【Starke Klebkraft】Mit einem ultra-starken 3M VHB-Klebestrip kann dieser Telefon-Fingerständer fest mit Ihrem Smartphone verbunden werden (hält 5 kg Schwerkrafttest stand), um Ihr Gerät vor versehentlichem Herunterfallen und Verrutschen zu schützen. Der 3M-Klebestrip kann auf verschiedenen Oberflächen wie Silikon, Gummi und Leder angebracht werden. Zwei zusätzliche 3M- Klebestrips sind im Lieferumfang enthalten.|【360°Drehbar &amp; 180°einstellbar】Der Syncwire-Handyhalter ist 360° drehbar und 180° klappbar, so dass Sie Ihr Handy jederzeit in Ihrem besten Blickwinkel positionieren können. Dieser Ringgriff wurde getestet, um 6000-mal gefaltet zu werden, ohne sich zu lösen. Die Metallplatte ist die perfekte Ergänzung zu einer magnetischen Autohalterung.|【Multifunktional】Dieser vielseitige Telefonhalter bietet Ihnen die Möglichkeit, Ihre Hände frei zu halten und Ihr Smartphone vor versehentlichen Stürzen und Ausrutschen zu schützen, während Sie in überfüllten Bussen oder U-Bahnen unterwegs sind. Sie können es auf Ihrem Schreibtisch, Ihrer Küchentheke oder Ihrem Tisch platzieren, um Filme anzusehen, Musik zu hören, Make-up aufzutragen, Videoanrufe zu tätigen oder sogar Spiele zu spielen.|【Weitgehend kompatibel】Der Syncwire Telefon-Ringhalter kann mit 4-8 Zoll Smartphones wie dem iPhone 11 Pro Max XS Max XR X 8 8 plus 7 7 plus 6s 6s plus 6 6 plus 5 5s 5c se, Samsung Galaxy S10+ S10 S9+ S9 S8+ S8 S7 S6 S5, Note 9 8 7 6 5, LG, Sony, Nexus, Nokia, Google Pixel und anderen Android-Handys verwendet werden. (Kann nicht während des kabellosen Ladevorgangs verwendet werden).');
INSERT INTO `handy-ringhalter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Handy-Ringhalter/Eono Handy-Ringhalter.webp;', 'Eono Handy-Ringhalter', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MToxMDc4MzI0MDE0MDIzMTI3OjE2Njc2NDQxNjI6c3BfYXRmOjIwMDY5Njk4MTY0MTk4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2Faceyoon-ringhalter-handyhalter-Katzenohren-Silbergrau%2Fdp%2FB073ZC1MD2%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D1C8JEH4AWCXXN%26keywords%3DEono%2BHandy-Ringhalter%26qid%3D1667644162%26qu%3DeyJxc2MiOiIwLjkyIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3D%252Caps%252C88%26sr%3D8-2-spons%26psc%3D1', '11,98', 4.4, 3788, 3, 'aceyoon;Edelstahl;📱【HochWertige Materialien】Der Fingerring Halter für Handy ist aus hochwertiger Zinklegierung und Edelstahl gefertigt. Dieser Halter ist ultradünn, nur 3 mm. Zinklegierung hat eine gute Duktilität und verfügt über Robustheit, die zu einer langen Lebensdauer beiträgt. Polierter Ringhalter, glatte Kante, keine Sorge um Kratzer an den Fingern.|📱【Multi-Funktionen】Dieser Handy Fingerhalter für das iPhone 6 verfügt über ein multifunktionales Design, kann nicht nur Stürze vermeiden, sondern auch als Tischständer für Handys verwendet werden. Sie können es auf Ihrem Schreibtisch, Ihrer Küchentheke oder Ihrem Tisch platzieren, um Filme anzusehen, Musik zu hören, Make-up aufzutragen, Videoanrufe zu tätigen oder sogar Spiele zu spielen. Hinweis: Dieser Halter kann nicht auf Glas verwendet werden.|📱【360 ° Drehung und 180 ° einstellbar】 Der Telefon Ring-Ständer zeichnet sich durch eine große Dichtigkeit aus, so dass Sie ihn einstellen und umdrehen können und er bleibt fest fixiert. Es ist ein perfekter Fingerring Ständer im Landschafts-oder Porträtmodus zum Lesen, Videos anschauen.|📱【Starke Klebkraft】Mit einem ultra-starken 3M VHB-Klebestrip kann dieser Telefon-Fingerständer fest mit Ihrem Smartphone verbunden werden, um Ihr Gerät vor versehentlichem Herunterfallen und Verrutschen zu schützen. Klebstoff ist extrem klebrig, wodurch das Telefon festgehalten wird und bei vielen Gelegenheiten das Herunterfallen des Telefons verhindert wird.|📱【Weitgehend kompatibel】Der Ringhalter kann mit 4-8 Zoll Smartphones wie dem iPhone 12 Pro Max 12mini SE 2020 11 Pro 11 Pro Max XS Max XR X 8 8 plus 7 7 plus 6s 6s plus 6 6 plus 5 5s 5c se, Samsung Galaxy S10+ S10 S9+ S9 S8+ S8 S7 S6 S5, Note 9 8 7 6 5, LG, Sony, Nexus, Nokia, Google Pixel und anderen Android-Handys verwendet werden.');
